    constructor(props){
        super(props)
    }
    render(){
        return(
            <div style={{"padding":"2% 10% 2% 10%"}}>
            <Form inline>
                <FormGroup>
                    <Input style={{"border-radius":"50px", "height":"50px"}} type="text" placeholder="Search Images ..."></Input>
                </FormGroup>
                <FormGroup>
                    
                </FormGroup>
            </Form>
            <ImageModal></ImageModal>
            </div>
        );
    }
}

export default SearchBar
